const buildInitialState = (prefs?: Game): State => ({
  games: prefs || ({} as Game),
  reduced: true,
  balance: 100,
})

const selector = (state: RootState) => state.games
export const useGamesState = () => useSelector(selector)

const initialState = buildInitialState()

export const getGames = createAction<{
  searchParam?: string | null
  size?: 'reduced' | 'all'
}>('GET_GAMES')

export const updateBalance = createAction<{
  newBalance: number
  game?: string
}>('SET_BALANCE')

export default createReducer<State>(initialState, (builder) => {
  builder
    .addCase(getGames, (state, action) => {
      const firstGames = Object.fromEntries(
        Object.entries(availableGames).slice(0, 8),
      )

      if (action.payload.searchParam) {
        const games: Game = {}
        Object.keys(availableGames).forEach((game) => {
          if (
            availableGames[game].name
              .toLowerCase()
              .includes(action.payload.searchParam?.toLowerCase())
          ) {
            if (action.payload.size === 'reduced' && firstGames[game]) {
              games[game] = firstGames[game]
            }
            if (action.payload.size === 'all') {
              games[game] = availableGames[game]
            }
          }
        })
        state.reduced = !!(action.payload.size === 'reduced')
        state.games = games
      } else {
        state.games =
          action.payload.size === 'reduced' ? firstGames : availableGames
        state.reduced = !!(action.payload.size === 'reduced')
      }
    })
    .addCase(updateBalance, (state, action) => {
      state.balance = action.payload.newBalance
      localStorage.setItem(
        `@casino${action.payload.game}`,
        JSON.stringify(action.payload.newBalance),
      )
    })
})
